import React from 'react';
import './archDetailPage.css';

const ArchDetailPage = ({ description }) => {
  return (
    <div className="arch-detail-page">
      <div className="arch-content">
        <div className="arch-detail-description">
          {description.map((part, index) => (
            <React.Fragment key={index}>
              {part}
            </React.Fragment>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ArchDetailPage;
